description:
Are you ready for the Marriage Feast of the Lamb? Learn what this means, and how the traditional Jewish wedding perfectly pictures Jesus and His church. Read how REVELATION 19 describes the bride of Christ, and why we are made glad and rejoice!
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
